import React from 'react';
import githubLogo from './images/GitHub-Logo.png';
import gmailLogo from './images/gmail.png';
import linkedinLogo from './images/linkedin.png';
import whatsappLogo from './images/whatsapp.png';

const ContactPage = () => {
  return (
    <div style={styles.container}>
      <h1>Contact Me</h1>
      <ul style={styles.list}>
        <li style={styles.listItem}>
          <a href="https://github.com/yourusername" target="_blank" rel="noopener noreferrer" style={styles.link}>
            <img src={githubLogo} alt="GitHub" style={styles.icon} /> GitHub
          </a>
        </li>
        <li style={styles.listItem}>
          <a href="mailto:yourname@gmail.com" style={styles.link}>
            <img src={gmailLogo} alt="Gmail" style={styles.icon} /> Gmail
          </a>
        </li>
        <li style={styles.listItem}>
          <a href="https://www.linkedin.com/in/yourusername" target="_blank" rel="noopener noreferrer" style={styles.link}>
            <img src={linkedinLogo} alt="LinkedIn" style={styles.icon} /> LinkedIn
          </a>
        </li>
        <li style={styles.listItem}>
          <a href="https://wa.me/yourphonenumber" target="_blank" rel="noopener noreferrer" style={styles.link}>
            <img src={whatsappLogo} alt="WhatsApp" style={styles.icon} /> WhatsApp
          </a>
        </li>
      </ul>
    </div>
  );
};

const styles = {
  container: {
    fontFamily: 'Arial, sans-serif',
    backgroundColor: '#f4f4f4',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    height: '100vh',
    margin: '0',
    padding: '20px',
    borderRadius: '8px',
    boxShadow: '0 0 10px rgba(0, 0, 0, 0.1)',
  },
  list: {
    listStyleType: 'none',
    padding: '0',
  },
  listItem: {
    margin: '10px 0',
  },
  link: {
    textDecoration: 'none',
    color: '#333',
    display: 'flex',
    alignItems: 'center',
  },
  icon: {
    width: '24px',
    height: '24px',
    marginRight: '10px',
  }
};

export default ContactPage;
